            UserSkills.Id = _User.GetUserId();
            UserSkillModel newSkill = new UserSkillModel
            {
                SID = UserSkills.SID,
                Id = UserSkills.Id,
            };
            await _USdb.InsertSkills(newSkill);
            skillCount++;
        }
        else
        {
            NavManager.NavigateTo("/Profile");
        }

    }

